//搜索内容有加密，先是aes加密，然后又对aes加密的秘钥进行了rsa加密。
function aestojson(aesstr) {
	var zhengwen = aesstr.match(/data\":\"(.*?)\"/)[1];
	var aeskey = aesstr.match(/key\":\"(.*?)\"/)[1];
	var raskey = "";
	var raskey = java.base64DecodeToByteArray(raskey);
	var rsacipher = java.createAsymmetricCrypto('RSA/ECB/PKCS1Padding');
	rsacipher.setPrivateKey(raskey);
	aeskey = rsacipher.decryptStr(aeskey, false);
	var i = aeskey.split("");
	i.reverse();
	var e = i.join("");
	var aesiv = e.substring(0, 16);
	var aescipher = java.createSymmetricCrypto('AES/CBC/PKCS7Padding', aeskey, aesiv);
	zhengwen = aescipher.decryptStr(zhengwen);
	//java.log(zhengwen);
	return JSON.parse(zhengwen);
}

