function Login() {
    Account = result['账号：'] ? result['账号：'] : source.getLoginInfoMap()["账号："];
    Password = result['密码：'] ? result['密码：'] : source.getLoginInfoMap()["密码："];
    if (Account == '' && Password == '') {
        login('【登录提示】' + '\n\n请输入账号和密码');
    } else if (Account == '') {
        login('【登录提示】' + '\n\n请输入账号');
    } else if (Password == '') {
        login('【登录提示】' + '\n\n请输入密码');
    } else {
        var pathname = source.bookSourceUrl + '/member/login/loginIn';
        var method = "POST";
        var imageUrl = 'https://www.jinglingdu.com/member/reg/image';
        var code = java.getVerificationCode(imageUrl);
        //username=274978887%40qq.com&password=ADCA6AC23439695D1F317844C26EA535&rememberme=Y&check=rrip
        var requestBody = 'username=' + Account + '&password=' + Password + '&rememberme=Y&check=' + code;
        var headers = "\{\"Content-Type\":\"application/x-www-form-urlencoded\"\}";
        var option = {
            "method": String(method),
            "body": String(requestBody),
            "headers": String(headers)
        };
        Response = java.ajax(pathname + ',' + JSON.stringify(option));
        if (JSON.parse(Response).msg == 'success') {
            java.log(Response);
            login('【登录提示】\n\n┏┅━┅━┅━┅━┅┅━┅━┅━┅━┅┓\n┋┋' + '\n' + Account + '\n┋┋' + '\n登录成功\n┋┋' + '\n┗┅━┅━┅━┅━┅┅━┅━┅━┅━┅┛');
        } else {
            java.log(Response);
            login('【登录提示】' + '\n' + Account + '\n登录失败\n\n请检查账号和密码');
        }
    }
}
