script.-1@html
@js:
var string = result;
var pattern = /https\:(.+)(?:jpg|gif)/g;
var matches = [];
var match;
while ((match = pattern.exec(string)) !== null) {
    matches.push(match[0]);
}
(function getImgList() {
    var piclist = matches.slice();
    return piclist;
}()).map(url=>
'<img src="'+url+'">').join("\n")

